import React from "react";

function ProCard(props) {
  return (
    <>
      <div className="over_text">
        <a
          href={props.weblink}
          className="text-xs border-p cursor-pointer"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img
            src={props.image}
            alt={props.alts}
            className="bg-gray-200 py-1 px-1 img-box transform hover:scale-105 ease-out duration-700 mb-1"
          />
          {props.title}
          <div class="overlay_pro">
            <div class="text_in_pro">Hello World</div>
          </div>
        </a>
      </div>
    </>
  );
}

export default ProCard;
